###### Article 14

Est prestataire de publicité, toute personne physique
ou morale qui intervient dans le processus de production
de la publicité. Il en est ainsi de :
- Artistes ;
- Agences-conseils en publicité ;
- Agences de publicité ;
- Agents de publicité ;
- Médias.

###### Article 17

Sans préjudice des dispositions des articles 5 alinéas
3 et 10 alinéa 3 du présent Arrêté, les pénalités
applicables en cas de violation du présent Arrêté sont,
suivant le cas :
- 2% du montant dû pour déclaration tardive par
mois de retard ;
- 5% du montant dû pour défaut de déclaration ;
- 10% du montant dû pour refus de déclaration ;
- 10% du montant dû pour absence de facture ;
- 30% du montant dû pour refus de paiement ;
- 50% du montant dû en cas de fraude ;
- 100% du montant dû en cas de récidive ;
- 6% par mois de retard de paiement de tout ou
e la redevance due.

