###### Article 25

Aucune demande de financement n’est recevable si
elle ne comporte les éléments suivants :
1. L’identité complète du titulaire ou du promoteur
du projet ;
2. Pour les personnes morales, tous documents
attestant son existence juridique et, le cas
échéant, la régularité de sa situation fiscale ;
3. Une fiche technique et descriptive du projet ;
4. Éventuellement le dossier de constitution des
garanties ;
5. Une lettre de demande de financement.
